    false,nt"url": null,nt"notes": "The plan describes how the refuge will
    use prescribed fire to treat hazardous fuels, enhance wildlife habitats, biological
    diversity and integrity, and delineates appropriate fire management responses needed
    to use precribed fire to achieve resource management goals. Such goals include 1)
    reduce the risk of wildlife through hazardous fuel management; 2) stimulate soil
    improvement and increase vigor of native plant communities; and 3) enhance grassland
    communities to provide early successional nesting, resting and feeding habitats
    for migratory birds.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
